import React, { useState } from 'react';
import { Menu, Users, MapPin, AlertTriangle, FileSpreadsheet, Car, LogOut } from 'lucide-react';

const menuItems = [
  { name: 'Conductor', icon: Users },
  { name: 'Pasajero', icon: Users },
  { name: 'Rutas', icon: MapPin },
  { name: 'Incidencias', icon: AlertTriangle },
  { name: 'Asignación', icon: FileSpreadsheet },
  { name: 'Auto', icon: Car },
];

const conductores = [
  { rut: '17665368-9', nombre: 'PERSONA 1', numero: '986432156', estado: 'ACTIVO' },
  { rut: '17800268-9', nombre: 'PERSONA 1', numero: '985466970', estado: 'NO ACTIVO' },
  { rut: '17859268-9', nombre: 'PERSONA 1', numero: '984461863', estado: 'NO ACTIVO' },
];

const pasajeros = [
  { rut: '17665368-9', nombre: 'PERSONA 1', numero: '', estado: '' },
  { rut: '17800268-9', nombre: 'PERSONA 2', numero: '', estado: '' },
  { rut: '17859268-9', nombre: 'PERSONA 3', numero: '', estado: '' },
];

function App() {
    const [selectedMenu, setSelectedMenu] = useState('Conductor');
    const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const renderTable = () => {
    const data = selectedMenu === 'Conductor' ? conductores : pasajeros;
    return (
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white">
          <thead className="bg-gray-100">
            <tr>
              <th className="px-4 py-2 text-left">RUT</th>
              <th className="px-4 py-2 text-left">NOMBRE</th>
              <th className="px-4 py-2 text-left">NÚMERO</th>
              <th className="px-4 py-2 text-left">ESTADO</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index} className={index % 2 === 0 ? 'bg-gray-50' : 'bg-white'}>
                <td className="px-4 py-2">{item.rut}</td>
                <td className="px-4 py-2">{item.nombre}</td>
                <td className="px-4 py-2">{item.numero}</td>
                <td className="px-4 py-2">{item.estado}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div className="flex flex-col h-screen bg-gray-100">
      <div className="bg-gray-800 text-white p-4 flex justify-between items-center">
        <h1 className="text-xl font-bold">PANEL DE CONTROL</h1>
        <button
          className="md:hidden"
          onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
        >
          <Menu />
        </button>
      </div>
      <div className="flex flex-1 overflow-hidden">
        <nav className={`bg-gray-200 w-64 p-4 flex-shrink-0 ${isMobileMenuOpen ? 'block' : 'hidden'} md:block`}>
          <div className="space-y-2">
            {menuItems.map((item) => (
              <button
                key={item.name}
                className={`flex items-center space-x-2 w-full p-2 rounded ${
                  selectedMenu === item.name ? 'bg-blue-500 text-white' : 'hover:bg-gray-300'
                }`}
                onClick={() => setSelectedMenu(item.name)}
              >
                <item.icon size={20} />
                <span>{item.name}</span>
              </button>
            ))}
          </div>
          <button className="flex items-center space-x-2 w-full p-2 rounded hover:bg-gray-300 mt-4">
            <LogOut size={20} />
            <span>CERRAR SESIÓN</span>
          </button>
        </nav>
        <main className="flex-1 p-4 overflow-auto">
          <h2 className="text-2xl font-bold mb-4">{selectedMenu}</h2>
          {(selectedMenu === 'Conductor' || selectedMenu === 'Pasajero') && renderTable()}
        </main>
      </div>
    </div>
  );
}

export default App;
